     dispatch(getPokemonName('bulbasaur'))
    const pokemones=useSelector(store =>store.pokemon.pokemons)
    console.log(pokemones)
  return (<>
  
     <br />
     <br />


     <div>PokemonDetall</div>
     <di>
        {
            pokemones.map(e=>e.name)
        }
     </di>
  
  
  </>
    
  )
}
